const CreateType = ({active, setActive}) => {

    console.log(active)

    return (
        <div onClick={()=>setActive} style={{width:'100%', height:'110vh', top:'0', background:'rgba(0, 0, 0, 0.219)'}} className={active ? 'd-flex position-fixed' : 'd-none'}>
            
        </div>
    );
};

export default CreateType;
